import React from "react";


const About = ()=>{
    return(
        <div>
            <h1>About</h1>
            <p className="my-1" >
                This is full stack React app for keeping contacts
            </p>
            <p className="bg-dark p">
                <strong>
                    Version:
                </strong>1.0.0
            </p>
        </div>
    );

};

export default About;
